import './Card.css';
import { Link } from "react-router-dom";


const Card = (props) => {
    return (
        <div id='card' >

                <h3>name: {props.name}</h3>

            <img src={props.image} alt="img" id='image' />
            <h3>continent: {props.continent}</h3>
        </div>
    )
}

export default Card;
